      "text": "Air cargo growth “encouraging” – AAPA  06 Air cargo growth “encouraging” – AAPA \nThe latest figures from Asia indicate strong global growth ahead of the Q4 peak season. \nAfter August saw double-digit air freight volume growth , bellwether results out of Asia suggest September saw market demand maintain its strong momentum. \nPreliminary traffic figures released earlier today by the Association of Asia Pacific Airlines (AAPA) found that international air cargo markets served by the region’s carriers again saw double-digit growth in traffic volumes in September, while international freight volumes carried by Asian airlines over the first nine months of the year were up by 10.7% year-on-year. \n“The global economy is in pretty good shape, with encouraging growth in both international air passenger and cargo demand seen this year,” said Andrew Herdman, AAPA Director General. \nInternational air cargo demand measured in freight tonne kilometres (FTK) increased by 11.4% last month compared to September 2016, ”reflecting the on-going pick-up in global trade across major advanced and emerging market economies,” said the AAPA. \nOffered freight capacity grew by 5.7%, resulting in a 3.4 percentage point rise in the average international freight load factor to 66.0% for the month. \nThe AAPA said improvements in global trade sentiment had delivered robust 10% growth in air cargo volumes so far this year, “a welcome development for Asian carriers which account for nearly 40% of global air cargo traffic”.",
