      "text": "October 24, 2017 Press Release No comments \nXY-Global is a professional custom-made metal casting suppies that sells high quality products across the global. This company is proud of the products that they provide for offering custom machining solutions for businesses so that company’s can ensure that they get the exact products that they need for their machines. XY-Global only offers the highest quality of products, a fact that this company takes a great deal of pride in. \nEstablished in 2005, XY-Global has a leading team of producers and research and development. Since they were established, there has been a heavy focus on producing high-quality CNC Machining Parts, CNC Lathe Machining, china Die casting parts on sales , and other similar materials. They even create parts for some of the leading brands including Samsung and LG. A spokesperson for the company had this to say: “We have a commitment to our customers to manufacture only the highest quality products while offering our clients the most competitive prices on the market. Customers think that they have to overpay to get the best quality products on the market; we are here to change that misconception.” \nThere are two areas where this company really excels: precision metal fabrication and quality management systems. Customers will love to see the wide array of products that they can find at this company from die casting parts, high quality lathe machine China supplier , and everything in between. “We take a great deal of pride in our selection and quality of products. If customers have any questions about what we offer and what they may need, our sales team has the knowledge that customers need to help them find the best products.” \nXY-Global also takes pride in their quality management systems. “What better way to ensure that we only put out the best quality products than to have an innovative quality management system? This helps us to ensure that we are putting out only the highest quality products.” XY-Global offers inspections reports and tests the equipment beyond the highest standards in the industry. By visiting their website, anyone can read all about the quality assurance process. “We firmly believe in transparency as this can build up a trusting relationship with our clients. We trust in our products so we want to make sure that our customers do as well.”This is something that is very important to this company. \nIf you would like to learn more about XY-Global, feel free to check out their website: http://www.xy-global.com/ \nMedia contact Company Name: XY Electronics Technology Co., Ltd. Contact Person: Ivy Liu Office Address: Room 403-405, LiJinCheng Commercial Building, JiHua Road, LongHua, Shenzhen, Guangdong, China Tele: +86 0755-82737469",
